  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0144288 includes Surface
  underway data collected from NUKA ARCTICA in the Davis Strait, Kattegat, The Sound,
  Great Belt, Little Belt, North Atlantic Ocean, North Sea and Skagerrak from 2007-04-27
  to 2008-01-05. These data include Partial pressure (or fugacity) of carbon dioxide
  - atmosphere, Partial pressure (or fugacity) of carbon dioxide - water and SEA SURFACE
  TEMPERATURE. The instruments used to collect these data include Carbon dioxide (CO2)
  gas analyzer, Shower head chamber equilibrator for autonomous carbon dioxide (CO2)
  measurement and thermosalinographs.nnThese data were collected by Truls Johannessen
  and Are Olsen of University of Bergen; Bjerknes Center for Climate Research; Geophysical
  Institute as part of the VOS_Nuka_Arctica_2007 data set. CDIAC associated the following
  cruise ID(s) with this data set: 26NA20070427nnThe Global Volunteer Observing Ship
  (VOS) Program is coordinated by the UNESCO International Ocean Carbon Coordination
  Project (IOCCP). International groups from 14 countries have been outfitting research
  ships and commercial vessels with automated CO2 sampling equipment to analyze the
  carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
